import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [message, setMessage] = useState('Loading...');
  const [users, setUsers] = useState([]);

  useEffect(() => {
    // Test backend connection
    axios.get('/api/auth/test-db')
      .then(response => {
        setMessage('HRMS Lite - Connected to Backend!');
      })
      .catch(error => {
        setMessage('HRMS Lite - Frontend Running (Backend not connected)');
      });
  }, []);

  return (
    <div style={styles.app}>
      <nav style={styles.navbar}>
        <div style={styles.navContent}>
          <h1 style={styles.logo}>HRMS Lite</h1>
          <div style={styles.navLinks}>
            <a href="#login" style={styles.navLink}>Login</a>
            <a href="#register" style={styles.navLink}>Register</a>
          </div>
        </div>
      </nav>

      <div style={styles.container}>
        <div style={styles.hero}>
          <h1 style={styles.heroTitle}>{message}</h1>
          <p style={styles.heroSubtitle}>Employee Management System</p>
          
          <div style={styles.featureGrid}>
            <div style={styles.featureCard}>
              <h3>üë• Employee Management</h3>
              <p>Manage employee records and information</p>
            </div>
            <div style={styles.featureCard}>
              <h3>üè¢ Department Management</h3>
              <p>Organize employees by departments</p>
            </div>
            <div style={styles.featureCard}>
              <h3>üìä Attendance Tracking</h3>
              <p>Track employee check-ins and check-outs</p>
            </div>
            <div style={styles.featureCard}>
              <h3>üîê Role-Based Access</h3>
              <p>Admin and Employee roles with different permissions</p>
            </div>
          </div>

          <div style={styles.ctaSection}>
            <h2>Get Started</h2>
            <div style={styles.buttonGroup}>
              <button 
                style={styles.primaryButton}
                onClick={() => window.location.href = '/login'}
              >
                Login to System
              </button>
              <button 
                style={styles.secondaryButton}
                onClick={() => window.location.href = '/register'}
              >
                Create Account
              </button>
            </div>
          </div>

          <div style={styles.status}>
            <p><strong>Backend Status:</strong> {message.includes('Connected') ? '‚úÖ Connected' : '‚ùå Not Connected'}</p>
            <p><strong>Frontend Status:</strong> ‚úÖ Running on Port 3000</p>
          </div>
        </div>
      </div>
    </div>
  );
}

const styles = {
  app: {
    minHeight: '100vh',
    background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
  },
  navbar: {
    backgroundColor: 'rgba(255, 255, 255, 0.1)',
    backdropFilter: 'blur(10px)',
    padding: '1rem 0',
    borderBottom: '1px solid rgba(255, 255, 255, 0.2)',
  },
  navContent: {
    maxWidth: '1200px',
    margin: '0 auto',
    padding: '0 20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  logo: {
    color: 'white',
    margin: 0,
    fontSize: '1.8rem',
    fontWeight: 'bold',
  },
  navLinks: {
    display: 'flex',
    gap: '20px',
  },
  navLink: {
    color: 'white',
    textDecoration: 'none',
    padding: '8px 16px',
    borderRadius: '4px',
    transition: 'background-color 0.3s',
  },
  container: {
    maxWidth: '1200px',
    margin: '0 auto',
    padding: '40px 20px',
  },
  hero: {
    textAlign: 'center',
    color: 'white',
  },
  heroTitle: {
    fontSize: '3rem',
    marginBottom: '1rem',
    fontWeight: 'bold',
  },
  heroSubtitle: {
    fontSize: '1.5rem',
    marginBottom: '3rem',
    opacity: 0.9,
  },
  featureGrid: {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
    gap: '20px',
    marginBottom: '3rem',
  },
  featureCard: {
    background: 'rgba(255, 255, 255, 0.1)',
    backdropFilter: 'blur(10px)',
    padding: '2rem',
    borderRadius: '12px',
    border: '1px solid rgba(255, 255, 255, 0.2)',
    transition: 'transform 0.3s',
  },
  ctaSection: {
    marginBottom: '3rem',
  },
  buttonGroup: {
    display: 'flex',
    gap: '15px',
    justifyContent: 'center',
    flexWrap: 'wrap',
  },
  primaryButton: {
    padding: '12px 30px',
    fontSize: '1.1rem',
    backgroundColor: '#007bff',
    color: 'white',
    border: 'none',
    borderRadius: '6px',
    cursor: 'pointer',
    transition: 'background-color 0.3s',
  },
  secondaryButton: {
    padding: '12px 30px',
    fontSize: '1.1rem',
    backgroundColor: 'transparent',
    color: 'white',
    border: '2px solid white',
    borderRadius: '6px',
    cursor: 'pointer',
    transition: 'background-color 0.3s',
  },
  status: {
    background: 'rgba(0, 0, 0, 0.2)',
    padding: '1.5rem',
    borderRadius: '8px',
    fontSize: '1.1rem',
  }
};

export default App;
